import "./App.css";
import { useEffect } from "react";
import getData from "./api/api";

function App() {
  useEffect(() => {
    let data = getData();
    setData(data);
  }, []);
  return (
    <div className="App">
      <p>Hello World</p>
    </div>
  );
}

export default App;
